metadata.prompt:
date
        Return the data in valid JSON format. For each extracted field, include:
        - The field value
        - A confidence score between 0 and 1
        - The location in the document (page number, coordinates)

        Example format:
        {
          "field_name": {
            "value": "extracted value",
            "confidence": 0.95,
            "location": {
              "page": 1,
              "coordinates": {
                "x": 100,
                "y": 200,
                "width": 300,
                "height": 50
              }
            }
          },
          "nested_field": {
            "sub_field": {
              "value": "nested value",
              "confidence": 0.8,
              "location": {
                "page": 1
              }
            }
          },
          "array_field": [
            {
              "value": "item 1",
              "confidence": 0.9,
              "location": {
                "page": 1
              }
            },
            {
              "value": "item 2",
              "confidence": 0.85,
              "location": {
                "page": 1
              }
            }
          ]
        }
